B.I7=new A.fz("patisserie","La Patisserie mobile app","UX/ UI Design","This was my first project  during my UX Design Google Course. It\u2019s a mobile app created for a French patisserie.\n          \nThe objective was to give to the customers an alternative to buy their pastries. This is a mobile shop application where the personas can buy pastries online without moving home.\n          \nThe project was born during pandemic times when de people can't go outside to buy groceries. Also, is designed for people who doesn't have time to go to the patisserie store because of the limited time after work or a busy day.","https://www.behance.net/gallery/126540663/La-Patisserie-App-Study-Case","cover.webp",B.dV,B.nd,B.E_,!1,0)
